    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on North Dakota Wetland Management Districts for
    the next 15 years. This plan outlines the districts' vision and purpose and describes
    how North Dakota Wetland Management Districts will contribute to the overall mission
    of the Refuge System. The plan provides an introduction to the WMDs, an overview
    of the CCP process, a summary of WMD resources, and information about the management
    direction. Key planning issues include: wetland habitats, upland habitats, wildlife
    management, operations, and monitoring.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
